I am unable to reproduce the problem too.

One thing is that in this case the exception we see in the stack trace is the exception hapenning in the exception handler:

package org.eclipse.core.internal.compatibility;
...
public class PluginActivator implements BundleActivator {
...
	public void start(BundleContext context) throws Exception {
	...
	try {
		plugin.start(context);	<<== the original exception hapens here
		plugin.startup();	<<== or here and is not recorded
	} catch(Exception e) {
		plugin.shutdown(); <<== the recorded exception happened here
		...
		throw e;
	}
...

So I created a patch that puts exception handing around the exception handling :-). (Note that normal RuntimeLog.log can't be used in this state.)
